import styled from "styled-components";
import Footer from "../footer";
import Navbar from "../header";

const BusinessLand= styled.section`
display:grid;
grid-template-columns:50% 50%;
height:700px;
margin-top:12%;`;
function BusinessCard() {
    return (
        <>
        <Navbar />
        <BusinessLand>
        <img src="https://i0.wp.com/4.bp.blogspot.com/-pN30-bal-1o/VwtDBbnbpkI/AAAAAAAAm2E/ULYKwzLdXXQL4joCsR2fvBKdtrDkuHTOw/s1600/Fotografo%2BProfessionista.jpg?ssl=1" alt="diocane" />
        <h1>naggia o core e crist</h1>
        </BusinessLand>
        <Footer/>
        </>
    )
}
export default BusinessCard;
